import React from 'react';
import WorkExp1 from './WorkExp1';
import WorkExp2 from './WorkExp2';

const Work = () => {
    return (
        <div className='work-page'>
            <h2 className='heading'>Work Experience</h2>
            <p>I've done some time, yes.</p>
            <WorkExp1 />
            <WorkExp2 />
        </div>
    )
}

export default Work;
